import React, { Component } from 'react';
import Stacks from './Stacks';

/**************
Holds the daily stacks view
**************/

class View_Stacks extends Component {
  render() {
    return (
      <div>
        <p>Stacks View </p>
      </div>
    );
  }
}



export default ViewStacks;
